import React from 'react'
import { AuthGuard } from '../controls/AuthGuard'
import { useAuth } from '../controls/auth'

const Dashboard = () => {
    const {logout} = useAuth();
  return (
    <AuthGuard>
    <div>
        Dashboard
    <button type='button' onClick={logout}> Logout </button>
    </div>
    </AuthGuard>
  )
}

export default Dashboard
